class DashboardContainer extends Component {
  static defaultProps = {
    center: {
      lat: 45.5053,
      lng: -73.5525
    },
    zoom: 11
  };



  render() {
    return (
      <>

            /*<CalendarView />*/
            <Calendar />
            <div className='maps-container'>

                <GoogleMapReact
                    bootstrapURLKeys={{ key: 'AIzaSyDMRW2COun3qq-v7ghHeR4SphxE1-hpkgk' }}
                    defaultCenter={this.props.center}
                    defaultZoom={this.props.zoom}
                >

                    <AnyReactComponent
                        lat={45.5053}
                        lng={-73.5525}
                        text="My Marker" />


                </GoogleMapReact>
            </div></>
    );
  }
}

